{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/akshayashokan02/cyclistic-bikeshare?scriptVersionId=213967601\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"229dd19b","metadata":{"papermill":{"duration":0.01001,"end_time":"2024-12-20T06:30:09.33516","exception":false,"start_time":"2024-12-20T06:30:09.32515","status":"completed"},"tags":[]},"source":["Case Study: How Does a Bike-Share Navigate Speedy Success?\n","\n","# Scenario\n","\n","I am a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, my team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve my recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","# Business task\n","\n","Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics.\n","\n","# Ask Question\n","These three following questions will guide the future marketing program and needed to be answered:\n","\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","   \n","# Preparation\n","\n","## Dataset Source\n","You will use Cyclistic’s historical trip data to analyze and identify trends. Download the previous 12 months of Cyclistic trip data from \"https://divvy-tripdata.s3.amazonaws.com/index.html\". (Note: The datasets have a different name because Cyclistic is a fictional company. For the purposes of this case study, the datasets are appropriate and will enable you to answer the business questions. The data has been made available by Motivate International Inc. under this license from \"https://ride.divvybikes.com/data-license-agreement\".)"]},{"cell_type":"code","execution_count":1,"id":"66d1a791","metadata":{"execution":{"iopub.execute_input":"2024-12-20T06:30:09.358859Z","iopub.status.busy":"2024-12-20T06:30:09.35582Z","iopub.status.idle":"2024-12-20T06:30:11.386087Z","shell.execute_reply":"2024-12-20T06:30:11.383684Z"},"papermill":{"duration":2.044668,"end_time":"2024-12-20T06:30:11.388956","exception":false,"start_time":"2024-12-20T06:30:09.344288","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.5\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.5.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.1\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n"]},{"name":"stderr","output_type":"stream","text":["── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\