s weekend more than weekdays. So, we may create a solution to encourage casuals to use bike weekends. Least popular bike usage time is between 02.00-08.00 which is home sleeping/resting time. Most popular bike usage time is 19.00-22.00. Casual biker travel twice longer than members. Docked bikes are used by casuals only.\n","\n","Electric bike is most popular bike type between all riders. Classic bikers, docked bikers, and electric bikers travel almost the same distance in terms of days of week. Casual and member bikers travel for similar time. Docked bikes are used for the longest journey by casual bikers. Casual bikers travel longer than members.\n","\n","Annual members ride bikes almost everyday of the week. However, casuals rides mostly weekdays. So, casuals would have benefits of having bike while using bikes weekeneds. Because, casuals ride longer distance than the annual members.There can be advertisent that show the advantages using bike weekend and in longer journeys. Thus, casual users could be encouraged buying annual plan."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":6333889,"sourceId":10242002,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":102.926786,"end_time":"2024-12-20T06:31:48.609611","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-12-20T06:30:05.682825","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}